$(document).ready(function(){var e=$('#addToHeader').children();for(i=0;i<e.length;i++){if(e[i].name=='js'){$('head').append('<script src="'+e[i].value+'"</script>')}if(e[i].name=='css'){$('head').append('<link rel="stylesheet" type="text/css"'+'href="'+e[i].value+'" />')}}if($('#gologin').length>0){window.location.replace($('base')[0].href+'accounts/login/')}if($('#customloc').length>0){window.location.replace($('base')[0].href+$('#customloc')[0].value)}})